import collections
def longestOnes(A, K):
    mapping = collections.defaultdict(int)
    mapping[0] = -1
    numZero = 0
    maxLen = float('-inf')
    for idx, num in enumerate(A):
        if num == 0:
            numZero += 1
        if numZero not in mapping.keys():
            mapping[numZero] = idx
        diff = numZero - K
        if diff <= 0:
            maxLen = max(maxLen, idx + 1)
        elif (numZero - K) in mapping.keys():
            maxLen = max(maxLen, idx - mapping[numZero - K])
    return maxLen

